import React from "react";
import logo from "./../../imagenes/Screenshot 2023-07-31 023349.png";


const Footer= () => {
    return(
        <div className="container ms-0 me-0 ps- footer ">
            <div className="row">
                <div className="col-6">
                    <img class="img-fluid logo" src={logo} alt="Logo banco central"></img>
                </div>
                <div className="col-6">
                    
                </div>
            </div>
        </div>
    )    
}

export default Footer
